import React, { Component, Fragment } from 'react';
import { MainConsumer } from '../../contexts/ContextMain';
import './DeliveryPart.css';

class DeliveryPart extends Component {
  render() {
    return (
      <MainConsumer>
        {({ handleChangeDestinantion }) => (
          <div className="main-delivery">
            <div className="logo-iaai">
              <img src="img/logo-iaai.svg" alt="logo-iaai" />
            </div>
            <div className="main-delivery-content">
              <div className="main-delivery-city">
                <MainConsumer>
                  {({
                    zip,
                    addressClient,
                    addressVehicle,
                    countryState,
                  }) => {
                    console.log(countryState, '3333333#####333333');

                    if (
                      countryState &&
                      countryState.type === "I"
                    ) {
                      return (
                        <Fragment>
                          <div className="main-delivery-city_wrap">
                            <div className="city-list">
                              <span className="city-from">{`${
                                addressVehicle.city
                              }, ${
                                addressVehicle.state_code
                              }`}</span>
                              <img
                                className="arrow-image"
                                src="img/arrow.svg"
                                alt="arrow"
                              />
                              <span className="city-to">{`${
                                addressClient.city
                              }, ${
                                addressClient.state_code
                              }`}</span>
                            </div>
                            {/* <div className='order-delivery'>
                          <span>$440</span>
                        </div> */}
                          </div>
                          <div className="main-delivery-city_wrap">
                            <div className="city-list">
                              <span className="city-from">{`${
                                addressVehicle.city
                              }, ${
                                addressVehicle.state_code
                              }`}</span>
                              <img
                                className="arrow-image"
                                src="img/arrow.svg"
                                alt="arrow"
                              />
                              <span className="city-to">{`${
                                countryState.name
                              }, ${
                                addressClient.name
                              }`}</span>
                            </div>
                            {/* <div className='order-delivery'>
                          <span>$440</span>
                        </div> */}
                          </div>
                        </Fragment>
                      );
                    } else {
                      return (
                        <div className="main-delivery-city_wrap">
                          <div className="city-list">
                            <span className="city-from">{`${
                              addressVehicle.city
                            }, ${
                              addressVehicle.state_code
                            }`}</span>
                            <img
                              className="arrow-image"
                              src="img/arrow.svg"
                              alt="arrow"
                            />
                            <span className="city-to">{`${
                              addressClient.city
                            }, ${
                              addressClient.state_code
                            }`}</span>
                          </div>
                          {/* <div className='order-delivery'>
                          <span>$440</span>
                        </div> */}
                        </div>
                      );
                    }
                  }}
                </MainConsumer>
              </div>
              <a
                href="#"
                onClick={handleChangeDestinantion}
                className="change-destination"
              >
                Change Destination
              </a>
            </div>
          </div>
        )}
      </MainConsumer>
    );
  }
}

export default DeliveryPart;
